		document.addEventListener('click', function (event) {
			if (!event.target.classList.contains('subnav__lang')) {
				$('.subnav__tooltip')[0].classList.remove('subnav__tooltip--active');
			}
		});
	});

	function langShow(val) {
		var language = supportedLanguages[val];
		$('.subnav__lang')[0].firstChild.data = "\n\t\t\t" + language + "\n\t\t";

		var items = $('.subnav__tooltip__link');
		for (var i = 0; i < items.length; i++) {
			items[i].classList.remove('active');
			if (items[i].getAttribute('data-value') == val) items[i].classList.add('active');
		}
	}

	function langChange(val) {
		$.cookie('language', val, { expires: 10000 });
		location.reload();
