				event.target.classList.contains('nav__link')
				&& event.target.parentElement.classList.contains('has--sublinks')) {
				collapseLists();

				currentTarget.children[0].classList.add('active');
				if (currentTarget.getAttribute('data-value') != tabActived) {
					var content = currentTarget.querySelector('.content');
					content.style.display = 'block';
					currentTarget.classList.add('active');
				}
			}
			else {
				var subLinkActived;
				var docSubLink = document.querySelectorAll('.nav__sublink');
				for (var i = 0; i < docSubLink.length; i++) {
					docSubLink[i].classList.remove('active');
				}

				if (event.target.classList.contains('router-link-active')
					|| event.target.parentElement.classList.contains('router-link-active')) {
					if (event.target.classList.contains('nav__link__label')) {
						event.target.parentElement.classList.add('active');
					}
					else {
						event.target.classList.add('active');
					}
				}
				else {
					var subLinks = currentTarget.querySelectorAll('.nav__sublink');

					if (event.target.classList.contains('nav__sublink--gamma') ||
						(event.target.parentElement && event.target.parentElement.classList.contains('nav__sublink--gamma'))) {
						for (var i = 0; i < subLinks.length; i++) {
							if (subLinks[i].className.indexOf('router-link-active') !== -1) {
								subLinks[i].className += ' active'; // Adds 'active' class
							}
						}
					}

					if (event.target.classList.contains('nav__link__label')) {
						event.target.parentElement.classList.add('active');
						subLinkActived = event.target.getAttribute('data-args');
					}
					else {
						event.target.classList.add('active');
						subLinkActived = event.target.querySelector('.nav__link__label').getAttribute('data-args');
					}

					$.get("/api/menu.json", function (data) {
						for (var i = 0; i < data.length; i++) {
							if (data[i].subLink !== undefined && data[i].subLink.indexOf(subLinkActived) !== -1) {
								sessionStorage.setItem("depth1", data[i].name);
								sessionStorage.setItem("depth2", subLinkActived);
								sessionStorage.setItem("depth3", '');
								renderContent(true);
								break;
							}
						}
					}).fail(function (xhr, textStatus, errorThrown) {
						console.log("ERROR: Get list menu error !");
					});
				}
			}
		}
		else {
			collapseLists();
			if (event.target.classList.contains('nav__link__label')) {
				event.target.parentNode.classList.add('active');
			}
			else {
				event.target.classList.add('active');
			}

			var nav_sub_link = document.querySelectorAll('.nav__sublink');
			for (var i = 0; i < nav_sub_link.length; i++) {
				if (nav_sub_link[i].classList.contains('active')) nav_sub_link[i].classList.remove('active');
			}

			tabActived = currentTarget.getAttribute('data-value');

			sessionStorage.setItem("depth1", tabActived);
			sessionStorage.setItem("depth2", '');
			sessionStorage.setItem("depth3", '');
			renderContent(true);
		}
	});

	function collapseLists() {
		var contents = document.querySelectorAll('.content');
		for (var i = 0; i < contents.length; i++) {
			contents[i].style.display = 'none';
		}

		var navs = document.querySelectorAll('li.nav__item.has--sublinks');
		for (var i = 0; i < navs.length; i++) {
			navs[i].classList.remove('active');
		}

		var navLinks = document.querySelectorAll('a.nav__link');
		for (var i = 0; i < navLinks.length; i++) {
			navLinks[i].classList.remove('active');
		}
	}

	$('.hamburger').click(function () {
		$('.overlay--nav')[0].classList.add('overlay--visible');
		$('.layout--split__sidebar')[0].classList.add('is-active');
	});

	$(document).on('click', function (event) {
		if (!isParentTab(event) && !event.target.classList.contains('hamburger')) {
			jqueryNoConflict('.overlay--nav')[0].classList.remove('overlay--visible');
			jqueryNoConflict('.layout--split__sidebar')[0].classList.remove('is-active');
		}
	});

	function isParentTab(event) {
		return (event.target.classList.contains('nav__link__label')
			&& event.target.parentElement.classList.contains('nav__link') ||
			event.target.classList.contains('nav__link')
			&& event.target.parentElement.classList.contains('has--sublinks'))
	}
