<script type="text/javascript">
	var portForwadringLastData = {};
	var isEdited = stringToBoolean($('.page__title input[type="hidden"]').val());
	console.log(isEdited);

	$(document).ready(function () {
		if (isEdited) portForwadringLastData = getRuleValues();

		// Src network 
		$.get('/api/network/wan', function (wans) {
			var zones = $('div[name="src-network"] .ivu-select-dropdown-list');
			zones.empty();
			wans['out-body']['wan-list'].forEach(wan => {
				if (wan['use-nat']) {
					var li = `<li class="ivu-select-item">${wan.ifname}</li>`
					zones.append(li);
				}
			});
		}).fail(function (xhr, textStatus, errorThrown) { });

		if (isEdited) {
			// Source
			var src_network = $('div[name="src-network"] input[type="hidden"]').val();
			$('div[name="src-network"] .ivu-select-placeholder')[0].innerText = src_network;
			var lis = jqueryNoConflict('div[name="src-network"] .ivu-select-dropdown-list').find('li');
