	function getRuleValues() {	// TODO: Add validate here
		var isValid = true;
		var rule = {};

		rule['name'] = $('div[name="name"] .ivu-input').val().trim();
		if (!(isValidName(rule['name'])) || rule['name'].includes(" ")) {
			$('div[name="name"] [data-args="err.validation.letter-number-1"]').show();
			isValid = false;
		}

		rule['ifname'] = $('div[name="src-network"] input[type="hidden"]').val().trim();
		if(rule['ifname'] === "")
			isValid = false;

		rule['srcip'] = $('div[name="src-ip"] input[type="hidden"]').val().trim();
		if (rule['srcip'] === "any") {
			rule['srcip'] = "";
		}
		else if(rule['srcip'] === "custom"){
			rule['srcip'] = $('#custom_external_ip').val().trim();
			if(!isValidIpAddressNoSubnet(rule['srcip']))
				isValid = false;
		}
		else
		{
			if(!isEdited)
				isValid = false;
		}

		rule['startport'] = $('div[name="external-port"] input[type="hidden"]').val().trim();
		if(rule['startport'] === "")
			isValid = false;
		if (rule['startport'] === "custom") {
			rule['startport'] = $('#custom_external_port').val().trim();
			if(!isValidPort(rule['startport']))
				isValid = false;
		}

		rule['serverip'] = $('div[name="dest-ip"] input[type="hidden"]').val().trim();
		if(rule['serverip'] === "")
			isValid = false;
		if (rule['serverip'] == "custom") {
			rule['serverip'] = $('#custom_internal_ip').val().trim();
			if(!isValidIpAddressNoSubnet(rule['serverip']))
				isValid = false;
		}

		rule['intportstart'] = $('div[name="dest-port"] input[type="hidden"]').val().trim();
		if(rule['intportstart'] === "")
			isValid = false;
		if (rule['intportstart'] === "custom") {
			rule['intportstart'] = $('#custom_internal_port').val().trim();
			if(!isValidPort(rule['intportstart']))
				isValid = false;
		}

		rule['proto'] = $('div[name="protocol"] input[type="hidden"]').val().trim();
		if (rule['proto'] === "") {
			$('div[name="protocol"] .field__infotext--warning').show();
			isValid = false;
		}
		if (isValid)
			return rule;
		else
			return false;
	}

	function doEditRule() {
		var newRuleData = getRuleValues();
		if(portForwadringLastData === false || newRuleData ===false)
		{
			reportState("error","Edit rule failed",true);
			return;
		}
		var protocolString;
		if(portForwadringLastData['proto'] === "1")
			protocolString = "TCP";
		else if(portForwadringLastData['proto'] === "2")
			protocolString = "UDP";
		else
			protocolString = "TCP or UDP";

		var deleteJson = JSON.stringify({
			"in-body": {
				"name": portForwadringLastData['serverip'] + '|' + portForwadringLastData['startport'] + '|' + portForwadringLastData['startport'] + '|' + protocolString
					+ '|' + portForwadringLastData['intportstart'] + '|' + portForwadringLastData['intportstart']
			}
		});

		ajaxApi({
			type: 'DELETE',
			url: 'access-control/nat/port-forwarding',
			async: true,
			data: deleteJson,
			success: function () {
				doAddRule();
			},
			error: function () {
				reportState("error", "Delele failed", true);
				locationReloadTimeout();
			}
		});
	}

	function doAddRule() {
		var data = getRuleValues();

		if (!data)
		{
			reportState("error","Add rule failed",true);
			return;
		}

		var jsonData = JSON.stringify({
			"in-body": {
				"interface": data['ifname'],
				"proto": data['proto'],
				"source-ip": data['srcip'],
				"source-port": data['startport'],
				"dest-ip": data['serverip'],
				"dst-port": data['intportstart'],
				"name": data['name']
			}
		});

		ajaxPutApi(
			'access-control/nat/port-forwarding',
			jsonData,
			true,
			function (response) {
				reportState('success');
				locationReloadTimeout();
			},
			function (xhr, textStatus, errorThrown) {
				reportState('error');
				locationReloadTimeout();
			}
		);
	}
